import { useCallback } from "react";
import api from "../services/api";

const useAddRepository = async (): Promise<void> => {
  try {
    const response = await api.get(`/user`);

    const { data } = response;
    console.log(data);

    if (!data) {
      console.error("An error has occurrend!");
    }

    return data;
  } catch (error) {
    console.error(error);
  }
  return null;
};
const useAddRepositoryData = () => {
  const response = useCallback(async () => {
    // eslint-disable-next-line react-hooks/rules-of-hooks
    const data = await useAddRepository();

    return data;
  }, [useAddRepository]);

  return { response };
};

export default useAddRepositoryData;
